  const txtToPdf = async (mainPdf, txt) => {
    if (!txt || !txt.trim()) {
      return Promise.resolve()
    }

    let page = mainPdf.addPage(PageSizes.A4)
    const height = page.getHeight()
    const textSize = 10
    const textHeight = customFont.heightAtSize(textSize)
    const a = txt.split('\n')
    const maxLines = Math.floor((height - 20) / textHeight)
    const promises = []
    for (let i = 0, j = 1; i < a.length; i += 1, j += 1) {
      if (j >= maxLines) {
        page = mainPdf.addPage(PageSizes.A4)
        j = 1
      }
      promises.push(page.drawText(a[i], { x: 20, y: height - textHeight * j - 20, size: textSize, font: customFont }))
    }
    return Promise.all(promises)
  }

